import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='flex flex-col h-screen justify-center bg-black'>
     <div className='bg-[#23262c] h-1/2 w-1/4 rounded-2xl shadow-2xl mx-auto p-10'>
        <div className='flex'>
          <img src='./images/icon-star.svg' alt='icon-star' className='w-10'/>
        </div>
        <h1 className='text-[28px] text-white mt-10 mb-8'>How did we do?</h1>
        <p className='text-[#969FAD] text-[15px]'> Please let us know how we did with your support request. All feedback is appreciated 
          to help us improve our offering!</p>
        <div className='flex justify-evenly'>
          <div className='bg-[#262E38] rounded-full w-14 h-14 flex justify-center items-center shadow-2xl'>1</div>
          <div className='bg-[#262E38] rounded-full w-14 h-14 flex justify-center items-center shadow-2xl'>2</div>
          <div className='bg-[#262E38] rounded-full w-14 h-14 flex justify-center items-center shadow-2xl'>3</div>
          <div className='bg-[#262E38] rounded-full w-14 h-14 flex justify-center items-center shadow-2xl'>4</div>
          <div className='bg-[#262E38] rounded-full w-14 h-14 flex justify-center items-center shadow-2xl'>5</div>
        </div>
        <button className='bg-[#FC7614] rounded-2xl'>Submit</button>
     </div>
    </div>
  );
}

export default App;
